import React from "react"
import { routes } from '../routes/routes';
import { Link } from "react-router-dom";
import { Image } from "antd";
import './Mennu.css'




const SideBar = () => {
  return (
    <div>


      <div className="menu w-80 pt-4 h-screen" style={{ backgroundColor: '#0F3634' }}>
        <div>
          <div className="logo flex h-5 mx-8" ><Image className='rounded-full' width={40} height={40} src='https://images.pexels.com/photos/220453/pexels-photo-220453.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500' />
            <div className="text-white">
              <div className="text-xs">Your Account</div>
              <div>Base</div>
            </div>
          </div>
        </div>
        <div className="mt-10 ">
          {
            routes.map((item, i) => (
              <div key={i} className='mx-8 h-12 text-white flex mennu'>
                <Link style={{ width: '95%' }} to={item.url}>{item.name}</Link>
                <div style={{ width: '5%' }} className="">{'>'}</div>
              </div>
            ))
          }
        </div>
      </div>

    </div>
  )
}
export default SideBar
